import{_ as t,a as e,b as r,c as o,d as l,e as i,f as n}from"./chunks/qgc_firmware_standard_vtol_fun_cub_quad.CBKDMaZ8.js";import{_ as s,c as d,a8 as p,o as u}from"./chunks/framework.BDnHobkS.js";const k=JSON.parse('{"title":"Volantex Ranger-Ex QuadPlane VTOL (Pixhawk)","description":"","frontmatter":{},"headers":[],"relativePath":"uk/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md","filePath":"uk/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"}'),h={name:"uk/frames_vtol/vtol_quadplane_volantex_ranger_ex_pixhawk.md"};function c(x,a,g,m,_,f){return u(),d("div",null,a[0]||(a[0]=[p('<h1 id="volantex-ranger-ex-quadplane-vtol-pixhawk" tabindex="-1">Volantex Ranger-Ex QuadPlane VTOL (Pixhawk) <a class="header-anchor" href="#volantex-ranger-ex-quadplane-vtol-pixhawk" aria-label="Permalink to &quot;Volantex Ranger-Ex QuadPlane VTOL (Pixhawk)&quot;">​</a></h1><p>QuadRanger VTOL - це стандартний повітряний літак з хвостовим оперенням на основі Volantex Ranger-Ex, який був модернізований з системою QuadCopter. Ranger-Ex є простою у виліті платформою FPV, яка широко доступна. Він також доступний в магазині HobbyKing, де він перевиданий як Quanum Observer. Пластиковий фюзеляж і 2-метрове крило EPO роблять його міцною конструкцією з величезним обсягом корисного навантаження.</p><p>Основна Інформація:</p><ul><li><strong>Frame:</strong> Volantex Ranger-Ex or <em>Quanum Observer</em></li><li><strong>Flight controller:</strong> Pixhawk</li></ul><p><img src="'+t+'" alt="QuadRanger"></p><p>Конверсія VTOL робить літак трохи важчим (близько 3,5 кг, включаючи LiPo). З цією конверсією літак буде летіти приблизно на 65% потужності двигуна. Запропонована чотирьохмоторна установка забезпечує тягу 7,5 кг, а конструкція повітряного каркасу може летіти з загальною вагою близько 4,5 кг. Це залишає достатньо потужності для вантажів, таких як обладнання для перегляду з першої особи та камери.</p><p>Конверсія призначена для мінімізації впливу на аеродинаміку та надання додаткової міцності для мінімізації згину крила.</p><h2 id="специфікація-матеріалів" tabindex="-1">Специфікація матеріалів <a class="header-anchor" href="#специфікація-матеріалів" aria-label="Permalink to &quot;Специфікація матеріалів&quot;">​</a></h2><ul><li>Volantex Ranger-Ex або Quanum Observer</li><li>1200KV 530W двигуни</li><li>Регулятори швидкості 30A</li><li>батарея 4s</li><li>Електричні гвинти APC 11x5</li></ul><h2 id="комплект-конверсіі" tabindex="-1">Комплект конверсії <a class="header-anchor" href="#комплект-конверсіі" aria-label="Permalink to &quot;Комплект конверсії&quot;">​</a></h2><ul><li>Необхідні основні частини;</li><li>Pixhawk або сумісний</li><li>Цифровий датчик швидкості польоту</li><li>Модуль живлення 3DR або сумісний</li><li>GPS</li></ul><p>For a full parts list with links to Hobbyking EU and International warehouse see: <a href="https://px4.io/wp-content/uploads/2016/01/QuadRanger-VTOL-partslist-1.xlsx" target="_blank" rel="noreferrer">QuadRanger-VTOL-partslist</a></p><p>Зображення нижче показує деталі, необхідні для одного крила.</p><p><img src="'+e+'" alt="QuadRanger Parts"></p><p>Необхідні інструменти для конвертації;</p><ul><li>Інструмент Dremel або подібний поворотний інструмент</li><li>Ніж для хобі</li><li>Клей UHU POR</li><li>Клей CA</li><li>Вимірювальний стрічка</li><li>Скотч</li></ul><p><img src="'+r+'" alt="QuadRanger conversion tools"></p><h2 id="конверсія-крила" tabindex="-1">Конверсія крила <a class="header-anchor" href="#конверсія-крила" aria-label="Permalink to &quot;Конверсія крила&quot;">​</a></h2><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Please note that the conversion in this build log is performed on a wing that shows damage from a previous conversion.</p></div><p>Відріжте обидва 800 мм квадратні вуглецеві труби до довжини 570 мм та 230 мм.</p><p>Виготовлення пазу у понівеченому крилі глибиною 1,5 см за допомогою обертаючого інструменту з якоюсь формою керівництва для збереження постійної глибини. Ящірка повинна мати довжину, глибину і ширину одного квадратного вуглецевого труби розміром 230 мм. Воно повинно бути розташоване так, як показано нижче.</p><p><img src="'+o+'" alt="QuadRanger carbon tube slot"></p><p>Приклейте вуглецевий лист розміром 300x150x1,5 мм до вуглецевої труби розміром 230 мм за допомогою клею CA та створіть отвір для прокладання проводів через нього. Вставте проводи для живлення та сигналу до ESC. Використовуючи клей UHU POR, приклейте лист і вуглепластикову трубку до крила з пінопласту, як показано нижче.</p><p><img src="'+l+'" alt="QuadRanger sheet attachment"></p><p>Використовуючи клей СА, заліпіть квадратну вуглецеву трубу довжиною 570 мм на вуглецевий лист. Воно повинно знаходитись на відстані 285 мм від місця приєднання крил. Трубка повинна бути центрована відносно вертикальної області крила. Він повинен розширюватися точно на 165 мм з обох сторін.</p><p>Прикріпіть кронштейн для двигуна до двигуна. З іншою пластиною кріплення двигуна та 4 гвинтами M3x25 мм закріпіть двигун на кінці квадратної вуглецевої труби, як показано нижче. Прикріпіть РЕБ зі стяжками до вуглецевої труби. Під час використання Afro ESC обов&#39;язково підключіть принаймні сигнальний та земельний провід.</p><p><img src="'+i+'" alt="QuadRanger motor and esc"></p><h2 id="підключення" tabindex="-1">Підключення <a class="header-anchor" href="#підключення" aria-label="Permalink to &quot;Підключення&quot;">​</a></h2><p>Виходи Pixhawk повинні бути підключені таким чином (орієнтація, як бачиться як &quot;сидячи в літаку&quot;).</p><table tabindex="0"><thead><tr><th>Порт</th><th>Підключення</th></tr></thead><tbody><tr><td>MAIN 1</td><td>Передній правий мотор, CCW</td></tr><tr><td>MAIN 2</td><td>Задній лівий мотор, CCW</td></tr><tr><td>MAIN 3</td><td>Передній лівий мотор, CW</td></tr><tr><td>MAIN 4</td><td>Задній правий мотор, CW</td></tr><tr><td>AUX 1</td><td>Лівий елерон</td></tr><tr><td>AUX 2</td><td>Правий елерон</td></tr><tr><td>AUX 3</td><td>Elevator</td></tr><tr><td>AUX 4</td><td>Rudder</td></tr><tr><td>AUX 5</td><td>Тяга</td></tr></tbody></table><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The servo direction can be reversed using the PWM_REV parameters in the PWM_OUTPUT group of QGroundControl (cogwheel tab, last item in the left menu)</p></div><p>For further instructions on wiring and configurations please see: <a href="./../config_vtol/vtol_quad_configuration.html">Standard VTOL Wiring and Configuration</a></p><h2 id="налаштування" tabindex="-1">Налаштування <a class="header-anchor" href="#налаштування" aria-label="Permalink to &quot;Налаштування&quot;">​</a></h2><p>Configure the frame as shown in QGroundControl below (do not forget to click <strong>Apply and Restart</strong> in the top).</p><p><img src="'+n+'" alt="QGC - select firmware for standard VTOL"></p><h2 id="підтримка" tabindex="-1">Підтримка <a class="header-anchor" href="#підтримка" aria-label="Permalink to &quot;Підтримка&quot;">​</a></h2><p>If you have any questions regarding your VTOL conversion or configuration please visit <a href="https://discuss.px4.io/c/px4/vtol" target="_blank" rel="noreferrer">https://discuss.px4.io/c/px4/vtol</a>.</p>',37)]))}const P=s(h,[["render",c]]);export{k as __pageData,P as default};
